import React, { Component } from 'react';
import Header from '../header/header';
import CardsPreview from './Types/CardsPreview'; 

class Cards extends Component {
    constructor(props) {
        super(props)
        this.state = {
            header: [
                { title: 'Cards & Payments' }
            ],
        }
    }
    render() {
        return (
            <div className="wrapper">
                <section className="container">
                    <div className="row">
                        <Header header={this.state.header[0].title} />  
                        <div className="row w-100">
                            <div className="col-md-12 mb-30">
                                <div className="h5 mb-20">Cards Preview</div>
                                <div className="row">
                                    <CardsPreview title1="current balance" price="$3 458.90" icon="Visa" title2="Benjamin Parker" cardNo="4321 0987 0000 9876" date="03/24" className="cards"/>
                                    <CardsPreview title1="current balance" price="$3 458.90" icon="Visa" title2="Benjamin Parker" cardNo="4321 0987 0000 9876" date="03/24" className="cards"/>
                                    <CardsPreview title1="current balance" price="$3 458.90" icon="Visa" title2="Benjamin Parker" cardNo="4321 0987 0000 9876" date="03/24" className="cards"/>
                                </div>
                            </div>
                        </div>
                    </div>
                </section>
            </div>
        );
    }
}

export default Cards;
